        Vue.component("v-23fe873145678", comp.default)
        next()
      })
    }
  },
  {
    name: "v-04fc074656565",
    path: "/tools/md-usage.html",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/Users/terminus-ct/workspace/code/vuetemplate/docs/tools/md-usage.md").then(comp => {
        Vue.component("v-04fc074656565", comp.default)
        next()
      })
    }
  },
  {
    name: "v-2796b78c4f8a9",
    path: "/tools/window-mac.html",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/Users/terminus-ct/workspace/code/vuetemplate/docs/tools/window-mac.md").then(comp => {
        Vue.component("v-2796b78c4f8a9", comp.default)
        next()
